import React from 'react';

const about = () => {
  return (
    <div>
      <h3 className="content">About</h3>
      <p>
        Lorem ipsum Exercitation culpa qui dolor consequat <br></br>
        exercitation fugiat laborum ex ea eiusmod ad do aliqua <br></br>
        occaecat nisi ad irure sunt id pariatur Duis laboris amet <br></br>
        exercitation veniam labore consectetur ea id quis eiusmod.
      </p>
    </div>
  );
};

export default about;
